import React from "react";
// Styling


const SearchBar = (props) => {

  const printSearch = (e) => {
    props.setQuery(e);
  }

  return (
    <input className="searchBar"
      onChange={(event) => printSearch(event.target.value)}
      placeholder="Search for a cookie name"
    />
  );
};

export default SearchBar;
